defmodule Reducer.Helper do
  @moduledoc """
    Helpers for Reducer.
  """
  # require Logger

  @input ""

  def input, do: @input

  @doc """
  convert a string to a freq count per letter

  ## Examples

      iex> Reducer.Helper.string_freq_count("abcdef")
      %{"a" => 1, "b" => 1, "c" => 1, "d" => 1, "e" => 1, "f" => 1}

      iex> Reducer.Helper.string_freq_count("bababc")
      %{"a" => 2, "b" => 3, "c" => 1}

  """
  def string_freq_count(str) do
    str
    |> String.split("", trim: true)
    |> Enum.reduce(%{}, fn(l, acc) -> acc |> Map.update(l, 1, &(&1 + 1)) end)
  end

  @doc """
  Does a Map have a Value as a Member?

  ## Examples

      iex> Reducer.Helper.map_value_member?(Reducer.Helper.string_freq_count("abcdef"), 2)
      false

      iex> Reducer.Helper.map_value_member?(Reducer.Helper.string_freq_count("bababc"), 2)
      true

      iex> Reducer.Helper.map_value_member?(Reducer.Helper.string_freq_count("bababc"), 3)
      true

      iex> Reducer.Helper.map_value_member?(Reducer.Helper.string_freq_count("bababc"), 4)
      false

  """
  def map_value_member?(%{} = f, n) do
    f |> Map.values() |> Enum.member?(n)
  end

  @doc """
  build grid and assign {x, y} points

  ## Examples

      iex> Reducer.Helper.grid(5) |> List.last()
      %{x: 4, y: 4}

      iex> Reducer.Helper.grid(5) |> List.first()
      %{x: 0, y: 0}

      iex> Reducer.Helper.grid(5, %{id: :custom}) |> List.last()
      %{id: :custom, x: 4, y: 4}

  """
  def grid(len \\ 10, src \\ %{}) do
    len = len - 1
    for x <- 0..len, y <- 0..len do
      src |> Map.merge(%{x: x, y: y})
    end
  end

end
